description:
The Battle for Syria

War Documentary hosted by Will Lyman, published by PBS broadcasted as part of PBS Frontline series in 2012 - English narration


Information
------------------------------

The Battle for Syria - As fighting rages in the streets of Syria's largest city, FRONTLINE Producer Jamie Doran and Correspondent Ghaith Abdul-Ahad journey to the heart of the insurgency, inside the rebel groups that are waging a full-scale assault on the forces of President Bashar al-Assad.Within &quot;liberated zones&quot; near the city of Aleppo, the rebels not only fight the Syrian Army, but struggle against each other in a bitter rivalry between secular and Islamist fighters. The Battle For Syria is an unprecedented portrait of Syria's rebel leaders, the toll of the war on civilians, and the outlines of a potential struggle for power in post-Assad Syria.

Also in this hour, The Regime Responds - FRONTLINE examines the way Syria's President Bashar al-Assad and his allies have managed to hold on to power despite years of unrest and in the face of a bloody civil war.

This program contains mature content, including graphic imagery that may not be appropriate for younger or more sensitive viewers. Viewer discretion is advised.

